import React from 'react';

const JsonData = () => {

    const dataTake = [
        {
            city: "Shikshon",
            zip: "1205"
        },
        {
            city: "Nowabganj",
            zip: "1211"
        },
        {
            city: "Tantibazar",
            zip: "1100"
        },
        {
            city: "KawranBazar",
            zip: "1300"
        }
    ]

    const DataItemCity = dataTake.map((dataCity) => {
        return <option> {dataCity.city} </option> 
    })
    const DataItemZip = dataTake.map((dataZip) => {
        return <option> {dataZip.zip} </option>
    })



    return (
        <div className="mt-5 text-center">
            <h1 className="ProColor"> JsonData এর কাজ </h1>

            <select>
                {DataItemCity}
            </select>
            <select>
                {DataItemZip}
            </select>

        </div>
    );
};

export default JsonData;
